document.write(`<style>
.landscape-ads-container {
    width: 100%;                     /* wajib full */
    display: grid;
    grid-template-columns: repeat(1, 1fr);
    gap: 20px;
    margin: 20px 0;
}

.landscape-ads-item {
    display: flex;
    align-items: flex-start;   /* teks mulai di atas */
    border: 1px solid #ddd;
    padding: 15px;
    background-color: #fff;
    box-shadow: 0 4px 8px rgba(0,0,0,0.1);
    border-radius: 8px;
    transition: transform .2s, box-shadow .2s;
    text-align: left;
}
.landscape-ads-item:hover {
    transform: translateY(-5px);
    box-shadow: 0 8px 16px rgba(0,0,0,0.2);
}
.landscape-ads-item div {
    flex: 1 1 auto;
    overflow: visible;          /* jangan dipotong */
    padding-right: 15px;
}
.landscape-ads-item img {
    float: none;                /* matikan float */
    flex-shrink: 0;             /* jangan diperkecil */
    width: 240px;
    max-width: 100%;
    height: auto;
    object-fit: cover;
    margin-right: 15px;
    margin-bottom: 0;           /* hapus jarak bawah */
    border-radius: 8px;
    border: 1px solid #ddd;
}
.landscape-ads-item a {
    color: #333;
    text-decoration: none;
    font-weight: bold;
}
.landscape-ads-item a:hover {
    text-decoration: underline;
    color: #007BFF;
}
.landscape-ads-item p {
    margin: 5px 0;
    font-size: 14px;
    color: #666;
}
.landscape-ads-item small {
    font-size: 12px;
    color: #999;
}
/* RESPONSIVE MOBILE */
@media (max-width: 600px) {
  .landscape-ads-container {
    grid-template-columns: 1fr;
  }
  .landscape-ads-item {
    flex-direction: column;
    text-align: center;
  }
  .landscape-ads-item div {
    padding: 0 0 10px;
  }
  .landscape-ads-item img {
    width: 100%;
    margin: 0 0 10px;
  }
}
</style>`);document.write('<div id="feedContainer"></div>');  
